  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Clear
  Lake National Wildlife Refuge outlines Refuge accomplishments during the 1981 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. Habitat management is also covered; subjects include
  wetlands, forests, grazing, fire management, and pest control. The wildlife section
  of the report discusses endangered and threatened species, waterfowl, marsh birds
  and waterbirds, shorebirds, raptors, and game mammals. The public uses of the Refuge
  described in this report include hunting, wildlife observation, outdoor recreation,
  and law enforcement.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
